import React from 'react'
class LifeCycle extends React.Component {
  state = {
    title: 'hello'
  }
  showData = event => {
    this.setState({
      title: event.target.value
    })
  }
  render () {
    return (
      <div>
        <input placeholder='' onBlur={this.showData}></input>
        <p></p>
      </div>
    )
  }
}
